té pour mettre toutes les chances de votre côté.</p><p data-v-c390a4b4=""><a href="https://sso.dossierfacile.logement.gouv.fr/auth/realms/dossier-facile/protocol/openid-connect/registrations?client_id=dossier-facile-frontend&amp;redirect_uri=https%3A%2F%2Flocataire.dossierfacile.logement.gouv.fr%2Fprofile&amp;response_type=code&amp;scope=openid" class="fr-btn fr-mt-2w" data-v-c390a4b4=""><span class="text-center full-width" data-v-c390a4b4="">Monter mon dossier de location</span></a></p></div></div></div></section><section class="fr-pb-md-5w fr-pt-md-9w fr-pt-3w" data-v-c390a4b4=""><div class="fr-container" data-v-c390a4b4=""><div class="fr-grid-row" data-v-c390a4b4=""><div class="fr-col-md-4 fr-grid-col fr-p-2w" data-v-c390a4b4=""><div class="fr-tile fr-enlarge-link" data-v-c390a4b4=""><div class="fr-tile__body" data-v-c390a4b4=""><h2 class="fr-tile__title" data-v-c390a4b4=""><div class="fr-tile__link" data-v-c390a4b4="">Démarquez-vous grâce à un dossier de qualité</div></h2><p class="fr-tile__desc" data-v-c390a4b4="">Transmettez aux propriétaires un dossier clair, complet et cohérent pour maximiser vos chances.</p></div><div class="fr-tile__img" data-v-c390a4b4=""><img src="/assets/approval-Cg12R6yl.svg" class="fr-responsive-img" alt="" data-v-c390a4b4=""></div></div></div><div class="fr-col-md-4 fr-grid-col fr-p-2w" data-v-c390a4b4=""><div class="fr-tile fr-enlarge-link" data-v-c390a4b4=""><div class="fr-tile__body" data-v-c390a4b4=""><h2 class="fr-tile__title" data-v-c390a4b4=""><div class="fr-tile__link" data-v-c390a4b4="">Soyez le premier à répondre à une annonce</div></h2><p class="fr-tile__desc" data-v-c390a4b4="">Soyez le plus réactif en envoyant en un clic votre dossier numérique.</p></div><div class="fr-tile__img" data-v-c390a4b4=""><img src="/assets/sports-B4YJDPKW.svg" class="fr-responsive-img" alt="" data-v-c390a4b4=""></div></div></div><div class="fr-col-md-4 fr-grid-col fr-p-2w" data-v-c390a4b4=""><div class="fr-tile fr-enlarge-link" data-v-c390a4b4=""><div class="fr-tile__body" data-v-c390a4b4=""><h2 class="fr-tile__title" data-v-c390a4b4=""><div class="fr-tile__link" data-v-c390a4b4="">Rassurez votre futur·e propriétaire</div></h2><p class="fr-tile__desc" data-v-c390a4b4="">Après une batterie de tests par nos opérateurs, votre dossier est labellisé par l'État.</p></div><div class="fr-tile__img" data-v-c390a4b4=""><img src="/assets/reading-D7e3hS8N.svg" class="fr-responsive-img" alt="" data-v-c390a4b4=""></div></div></div></div></div></section><section class="fr-pb-5w fr-pt-md-9w fr-pt-3w bg-blue-grey" data-v-c390a4b4=""><div class="fr-container" data-v-c390a4b4=""><h2 class="fr-h2 s2-title" data-v-c390a4b4="">Constituez votre dossier de location en trois étapes</h2><div class="fr-grid-row reverse-mobile" data-v-c390a4b4=""><div class="fr-col-md-6 fr-grid-col" data-v-c390a4b4=""><ol data-v-c390a4b4=""><li data-v-c390a4b4=""><div class="fr-grid-row align-items--center" data-v-c390a4b4=""><p class="step-number" data-v-c390a4b4="">1</p><h3 class="fr-h4 fr-mb-0" data-v-c390a4b4="">Je télécharge mes pièces</h3></div><div data-v-c390a4b4="">DossierFacile vous demande les pièces nécessaires et rien que celles-là&nbsp;!</div><ul class="fr-pt-2w fr-mb-5w" data-v-c390a4b4=""><li data-v-c390a4b4="">Pièce d'identité</li><li data-v-c390a4b4="">Justificatif de situation d'hébergement</li><li data-v-c390a4b4="">Justificatif de situation professionnelle</li><li data-v-c390a4b4="">Avis d'imposition</li><li data-v-c390a4b4="">Justificatif de ressources</li></ul></li><li data-v-c390a4b4=""><div class="fr-grid-row align-items--center" data-v-c390a4b4=""><p class="step-number" data-v-c390a4b4="">2</p><h3 class="fr-h4 fr-mb-0" data-v-c390a4b4="">DossierFacile valide mon dossier</h3></div><p data-v-c390a4b4="">Nos agents vérifient votre dossier et vous aident à le corriger si besoin.</p></li><li data-v-c390a4b4=""><div class="fr-grid-row align-items--center" data-v-c390a4b4=""><p class="step-number" data-v-c390a4b4="">3</p><h3 class="fr-h4 fr-mb-0" data-v-c390a4b4="">Mon dossier est prêt à être envoyé</h3></div><p data-v-c390a4b4="">Votre dossier sécurisé sous forme de lien URL ou au format PDF est prêt à être envoyé aux propriétaires et aux agences.</p></li></ol><a href="//docs.dossierfacile.fr" target="_blank" class="fr-btn fr-btn--secondary fr-mt-2w" data-v-c390a4b4=""><span class="text-center full-width" data-v-c390a4b4="">Comment préparer mon dossier de location</span></a><a href="https://sso.dossierfacile.logement.gouv.fr/auth/realms/dossier-facile/protocol/openid-connect/registrations?client_id=dossier-facile-frontend&amp;redirect_uri=https%3A%2F%2Flocataire.dossierfacile.logement.gouv.fr%2Fprofile&amp;response_type=code&amp;scope=openid" class="fr-btn fr-mt-2w" data-v-c390a4b4=""><span class="text-center full-width" data-v-c390a4b4="">Monter mon dossier de location</span></a></div><div class="fr-col-md-6 mx-auto" data-v-c390a4b4=""><picture data-v-c390a4b4=""><source media="(max-width: 499px)" srcset="data:image/webp;base64,, data:image/webp;base64, 1.5x, data:image/webp;base64, 2x" data-v-c390a4b4=""><source media="(min-width: 500px) and (max-width: 1200px)" srcset="data:image/webp;base64,, data:image/webp;base64, 1.5x" data-v-c390a4b4=""><source media="(min-width: 1200px)" srcset="data:image/webp;base64," data-v-c390a4b4=""><img loading="lazy" src="data:image/webp;base64," alt="" class="justif-img" data-v-c390a4b4=""></picture></div></div></div></section><section class="bg--orange fr-pb-md-5w fr-pt-md-9w fr-pt-3w" data-v-c390a4b4=""><div class="fr-pt-7w fr-pb-7w" data-v-c390a4b4=""><div class="fr-container" data-v-c390a4b4=""><h2 class="fr-h2 s3-title" data-v-c390a4b4="">Protégez vos informations personnelles</h2><p data-v-c390a4b4="">Avec DossierFacile, plus de papiers d'identité éparpillés dans la nature&nbsp;! <br data-v-c390a4b4=""> Vos documents sont recouverts de filigranes pour vous protéger contre la fraude de propriétaires peu scrupuleux.</p><p data-v-c390a4b4="">Vous pouvez paramétrer l'ouverture de votre lien dossier : vous pouvez le supprimer à tout moment&nbsp;!</p></div></div></section><section class="fr-pb-md-5w fr-pt-md-9w fr-pt-3w" data-v-c390a4b4=""><div class="fr-container fr-mb-7w" data-v-c390a4b4=""><h2 class="fr-h2 text-center" data-v-c390a4b4="">Déjà <span class="color--secondary" data-v-c390a4b4="">116000</span> Dossiers labellisés grâce à DossierFacile</h2><div class="text-center" data-v-c390a4b4=""><a href="/stats" class="fr-link fr-tag" data-v-c390a4b4=""><img src="data:image/webp;base64," class="stats-icon" alt="" data-v-c390a4b4=""> Consulter nos statistiques</a></div><div class="fr-grid-row" data-v-c390a4b4=""><div class="col fr-p-2w" data-v-c390a4b4=""><figure class="fr-quote fr-quote--column" data-v-c390a4b4=""><blockquote data-v-c390a4b4=""><p data-v-c390a4b4="">Le dossier de Karim s'est tout de suite démarqué : c'était le seul dossier reçu complet&nbsp;!</p></blockquote><figcaption data-v-c390a4b4=""><p class="fr-quote__author" data-v-c390a4b4="">Joseph, propriétaire à Nantes</p></figcaption></figure></div><div class="col fr-p-2w" data-v-c390a4b4=""><figure class="fr-quote fr-quote--column" data-v-c390a4b4=""><blockquote data-v-c390a4b4=""><p data-v-c390a4b4="">Simple, efficace et pratique : ça m'a fait gagner beaucoup de temps dans ma recherche d'appartement.</p></blockquote><figcaption data-v-c390a4b4=""><p class="fr-quote__author" data-v-c390a4b4="">Caroline, étudiante</p></figcaption></figure></div><div class="col fr-p-2w" data-v-c390a4b4=""><figure class="fr-quote fr-quote--column" data-v-c390a4b4=""><blockquote data-v-c390a4b4=""><p data-v-c390a4b4="">Je ne réussissais jamais à visiter un appartement avec mon dossier étranger. Avec DossierFacile, j'ai enfin eu plus de visites&nbsp;!</p></blockquote><figcaption data-v-c390a4b4=""><p class="fr-quote__author" data-v-c390a4b4="">Irina, étudiante en Erasmus</p></figcaption></figure></div></div><div class="text-center fr-mt-5w fr-mb-5w" data-v-c390a4b4=""><p da