 paramétrer l'ouverture de votre lien dossier : vous pouvez le supprimer à tout moment&nbsp;!</p></div></div></section><section class="fr-pb-md-5w fr-pt-md-9w fr-pt-3w" data-v-c390a4b4=""><div class="fr-container fr-mb-7w" data-v-c390a4b4=""><h2 class="fr-h2 text-center" data-v-c390a4b4="">Déjà <span class="color--secondary" data-v-c390a4b4="">116000</span> Dossiers labellisés grâce à DossierFacile</h2><div class="text-center" data-v-c390a4b4=""><a href="/stats" class="fr-link fr-tag" data-v-c390a4b4=""><img src="data:image/webp;base64," class="stats-icon" alt="" data-v-c390a4b4=""> Consulter nos statistiques</a></div><div class="fr-grid-row" data-v-c390a4b4=""><div class="col fr-p-2w" data-v-c390a4b4=""><figure class="fr-quote fr-quote--column" data-v-c390a4b4=""><blockquote data-v-c390a4b4=""><p data-v-c390a4b4="">Le dossier de Karim s'est tout de suite démarqué : c'était le seul dossier reçu complet&nbsp;!</p></blockquote><figcaption data-v-c390a4b4=""><p class="fr-quote__author" data-v-c390a4b4="">Joseph, propriétaire à Nantes</p></figcaption></figure></div><div class="col fr-p-2w" data-v-c390a4b4=""><figure class="fr-quote fr-quote--column" data-v-c390a4b4=""><blockquote data-v-c390a4b4=""><p data-v-c390a4b4="">Simple, efficace et pratique : ça m'a fait gagner beaucoup de temps dans ma recherche d'appartement.</p></blockquote><figcaption data-v-c390a4b4=""><p class="fr-quote__author" data-v-c390a4b4="">Caroline, étudiante</p></figcaption></figure></div><div class="col fr-p-2w" data-v-c390a4b4=""><figure class="fr-quote fr-quote--column" data-v-c390a4b4=""><blockquote data-v-c390a4b4=""><p data-v-c390a4b4="">Je ne réussissais jamais à visiter un appartement avec mon dossier étranger. Avec DossierFacile, j'ai enfin eu plus de visites&nbsp;!</p></blockquote><figcaption data-v-c390a4b4=""><p class="fr-quote__author" data-v-c390a4b4="">Irina, étudiante en Erasmus</p></figcaption></figure></div></div><div class="text-center fr-mt-5w fr-mb-5w" data-v-c390a4b4=""><p da