té pour mettre toutes les chances de votre côté.</p><p data-v-c390a4b4=""><a href="https://sso.dossierfacile.logement.gouv.fr/auth/realms/dossier-facile/protocol/openid-connect/registrations?client_id=dossier-facile-frontend&amp;redirect_uri=https%3A%2F%2Flocataire.dossierfacile.logement.gouv.fr%2Fprofile&amp;response_type=code&amp;scope=openid" class="fr-btn fr-mt-2w" data-v-c390a4b4=""><span class="text-center full-width" data-v-c390a4b4="">Monter mon dossier de location</span></a></p></div></div></div></section><section class="fr-pb-md-5w fr-pt-md-9w fr-pt-3w" data-v-c390a4b4=""><div class="fr-container" data-v-c390a4b4=""><div class="fr-grid-row" data-v-c390a4b4=""><div class="fr-col-md-4 fr-grid-col fr-p-2w" data-v-c390a4b4=""><div class="fr-tile fr-enlarge-link" data-v-c390a4b4=""><div class="fr-tile__body" data-v-c390a4b4=""><h2 class="fr-tile__title" data-v-c390a4b4=""><div class="fr-tile__link" data-v-c390a4b4="">Démarquez-vous grâce à un dossier de qualité</div></h2><p class="fr-tile__desc" data-v-c390a4b4="">Transmettez aux propriétaires un dossier clair, complet et cohérent pour maximiser vos chances.</p></div><div class="fr-tile__img" data-v-c390a4b4=""><img src="/assets/approval-Cg12R6yl.svg" class="fr-responsive-img" alt="" data-v-c390a4b4=""></div></div></div><div class="fr-col-md-4 fr-grid-col fr-p-2w" data-v-c390a4b4=""><div class="fr-tile fr-enlarge-link" data-v-c390a4b4=""><div class="fr-tile__body" data-v-c390a4b4=""><h2 class="fr-tile__title" data-v-c390a4b4=""><div class="fr-tile__link" data-v-c390a4b4="">Soyez le premier à répondre à une annonce</div></h2><p class="fr-tile__desc" data-v-c390a4b4="">Soyez le plus réactif en envoyant en un clic votre dossier numérique.</p></div><div class="fr-tile__img" data-v-c390a4b4=""><img src="/assets/sports-B4YJDPKW.svg" class="fr-responsive-img" alt="" data-v-c390a4b4=""></div></div></div><div class="fr-col-md-4 fr-grid-col fr-p-2w" data-v-c390a4b4=""><div class="fr-tile fr-enlarge-link" data-v-c390a4b4=""><div class="fr-tile__body" data-v-c390a4b4=""><h2 class="fr-tile__title" data-v-c390a4b4=""><div class="fr-tile__link" data-v-c390a4b4="">Rassurez votre futur·e propriétaire</div></h2><p class="fr-tile__desc" data-v-c390a4b4="">Après une batterie de tests par nos opérateurs, votre dossier est labellisé par l'État.</p></div><div class="fr-tile__img" data-v-c390a4b4=""><img src="/assets/reading-D7e3hS8N.svg" class="fr-responsive-img" alt="" data-v-c390a4b4=""></div></div></div></div></div></section><section class="fr-pb-5w fr-pt-md-9w fr-pt-3w bg-blue-grey" data-v-c390a4b4=""><div class="fr-container" data-v-c390a4b4=""><h2 class="fr-h2 s2-title" data-v-c390a4b4="">Constituez votre dossier de location en trois étapes</h2><div class="fr-grid-row reverse-mobile" data-v-c390a4b4=""><div class="fr-col-md-6 fr-grid-col" data-v-c390a4b4=""><ol data-v-c390a4b4=""><li data-v-c390a4b4=""><div class="fr-grid-row align-items--center" data-v-c390a4b4=""><p class="step-number" data-v-c390a4b4="">1</p><h3 class="fr-h4 fr-mb-0" data-v-c390a4b4="">Je télécharge mes pièces</h3></div><div data-v-c390a4b4="">DossierFacile vous demande les pièces nécessaires et rien que celles-là&nbsp;!</div><ul class="fr-pt-2w fr-mb-5w" data-v-c390a4b4=""><li data-v-c390a4b4="">Pièce d'identité</li><li data-v-c390a4b4="">Justificatif de situation d'hébergement</li><li data-v-c390a4b4="">Justificatif de situation professionnelle</li><li data-v-c390a4b4="">Avis d'imposition</li><li data-v-c390a4b4="">Justificatif de ressources</li></ul></li><li data-v-c390a4b4=""><div class="fr-grid-row align-items--center" data-v-c390a4b4=""><p class="step-number" data-v-c390a4b4="">2</p><h3 class="fr-h4 fr-mb-0" data-v-c390a4b4="">DossierFacile valide mon dossier</h3></div><p data-v-c390a4b4="">Nos agents vérifient votre dossier et vous aident à le corriger si besoin.</p></li><li data-v-c390a4b4=""><div class="fr-grid-row align-items--center" data-v-c390a4b4=""><p class="step-number" data-v-c390a4b4="">3</p><h3 class